import * as React from 'react';
import Form from 'react-bootstrap/Form';


function ToggleDarkMode() {
    return (
        <Form>
            <p></p>
            <Form.Check
            type="switch"
            id="custom-switch"
            label="Dark"
            />
        </Form>
    );
}

export default ToggleDarkMode;
